HRESULT 
Scramble(PUCHAR pData, UINT uiLength, UCHAR bInitialRegister, PUCHAR pbNewRegister)
{
    HRESULT hRes = S_OK;
    UCHAR bRegister = bInitialRegister;
    UINT i;
    
    do 
    {
        for (i = 0; i < uiLength; i++)
        {
            pData[i] = gc_ScramblerLUT[ pData[i] ][bRegister];
            bRegister = pData[i] >> 1;
        }

        *pbNewRegister = bRegister;
    } while (FALSE);

    return hRes;
}

HRESULT 
ScrambleMDLChain(PMDL pMdl, UCHAR bInitialRegister, PUCHAR pbNewRegister)
{
    HRESULT hRes        = S_OK;
    UCHAR   bRegister   = bInitialRegister;
    UINT    i;
    PUCHAR  pData       = NULL;

    do 
    {
        for (; pMdl != NULL; pMdl = pMdl->Next)
        {
            pData = (PUCHAR)pMdl->StartVa + pMdl->ByteOffset;
            for (i = 0; i < pMdl->ByteCount; i++)
            {
                pData[i] = gc_ScramblerLUT[ pData[i] ][bRegister];
                bRegister = pData[i] >> 1;
            }
            
        }

        *pbNewRegister = bRegister;
    } while (FALSE);

    return hRes;
}
